The five Bennet sisters have all raised by their mother with one purpose in life - finding a husband. However, the second eldest Lizzie can think of 100 reasons not to marry.

When Mrs Bennet hears the exiting news that a wealthy bachelor and his circle of sofisticated friends are to take up summer residence in a nearby mansion the Bennets are abuzz with the hope that potential suitors will be in full supply. Obligingly, the newcomer, Mr Charles Bingley, is immediately taken with the eldest Jane. However, when Lizzie meets up with the darkly handsome and snobbish Mr Darcy, what seems like a match made in heaven quickly becomes divided by pride and prejudice. Can tehy get past this and can Lizzie finally find a reason to marry?


